ow("common/bench.effekt",'module bench\n\n/**\n * The current time (since UNIX Epoch) in nanoseconds.\n *\n * The actual precision varies across the different backends.\n * - js: Milliseconds\n * - chez: Microseconds\n * - ml: Microseconds\n */\nextern io def timestamp(): Int \x3d\n  js "Date.now() * 1000000"\n  chez "(timestamp)"\n  ml "IntInf.toInt (Time.toNanoseconds (Time.now ()))"\n  llvm !!!MULTILINEMARKER!!!\n    %time_ptr \x3d alloca { i64, i64 }\n    call i32 @clock_gettime(i32 0, ptr %time_ptr)\n    %time \x3d load {i64, i64}, ptr %time_ptr\n    %time_seconds \x3d extractvalue {i64, i64} %time, 0\n    %time_nanoseconds \x3d extractvalue {i64, i64} %time, 1\n    %time_seconds_nanoseconds \x3d mul nsw i64 %time_seconds, 1000000000\n    %result \x3d add nsw i64 %time_seconds_nanoseconds, %time_nanoseconds\n    ret %Int %result\n  !!!MULTILINEMARKER!!!\n\nextern llvm !!!MULTILINEMARKER!!!\n  declare i32 @clock_gettime(i32, ptr)\n!!!MULTILINEMARKER!!!\n\n/**\n * High-precision timestamp in nanoseconds that should be for measurements.\n *\n * This timestamp should only be used for **relative** measurements,\n * as gives no guarantees on the absolute time (unlike a UNIX timestamp).\n */\nextern io def relativeTimestamp(): Int \x3d\n  js "Math.round(performance.now() * 1000000)"\n  default { timestamp() }\n\n/**\n * Runs the block and returns the time in nanoseconds\n */\ndef timed { block: \x3d\x3e Unit }: Int \x3d {\n  val before \x3d relativeTimestamp()\n  block()\n  val after \x3d relativeTimestamp()\n  after - before\n}\n\ndef measure(warmup: Int, iterations: Int) { block: \x3d\x3e Unit }: Unit \x3d {\n  def run(n: Int, report: Bool): Unit \x3d {\n    if (n \x3c\x3d 0) { () } else {\n      val time \x3d timed { block() };\n      if (report) { println(time) } else { () };\n      run(n - 1, report)\n    }\n  }\n  run(warmup, false)\n  run(iterations, true)\n}\n');
ow("common/buffer.effekt",'module buffer\n\nimport array\n\n// TODO (in Effekt compiler)\n// - [ ] fix allocating into actually global region\n// - [ ] fix exceptions on objects\n// - [X] allow omitting braces after `at` for singleton regions\n\nrecord BufferOverflow()\n\n/**\n * Fixed-size ring buffers (queues) where one can write\n * elements to the head and read from the tail.\n */\ninterface Buffer[T] {\n  /**\n   * The remaining capacity\n   */\n  def capacity(): Int\n\n  /**\n   * Is this buffer full?\n   */\n  def full?(): Bool\n\n  /**\n   * Is this buffer empty?\n   */\n  def empty?(): Bool\n\n  /**\n   * Read an element from the tail of the buffer\n   */\n  def read(): Option[T]\n\n  /**\n   * Write an element to the head of the buffer\n   */\n  def write(el: T): Unit / Exception[BufferOverflow]\n}\n\ndef emptyBuffer[T](capacity: Int): Buffer[T] at {global} \x3d {\n  if (capacity \x3d\x3d 1) refBuffer()\n  else arrayBuffer(capacity)\n}\ndef arrayBuffer[T](initialCapacity: Int): Buffer[T] at {global} \x3d {\n  // TODO allocate buffer (and array) into a region r.\n  val contents \x3d emptyArray[T](initialCapacity)\n  var head in global \x3d 0\n  var tail in global \x3d 0\n\n  def size(): Int \x3d\n    if (tail \x3e\x3d head) { tail - head }\n    else { initialCapacity - head + tail }\n\n  def capacity(): Int \x3d initialCapacity - size()\n\n  def buffer \x3d new Buffer[T] {\n    def capacity() \x3d capacity()\n    def full?() \x3d capacity() \x3c\x3d 0\n    def empty?() \x3d size() \x3c\x3d 0\n    def read() \x3d {\n      if (buffer.empty?) None()\n      else {\n        val result: T \x3d contents.remove(head).getOrElse { \x3c\x3e };\n        head \x3d mod(head + 1, initialCapacity)\n        Some(result)\n      }\n    }\n    def write(el: T) \x3d {\n      if (buffer.full?) \x3c\x3e // raise(BufferOverflow())\n\n      contents.put(tail, el)\n      tail \x3d mod(tail + 1, initialCapacity)\n    }\n  }\n  buffer\n}\ndef refBuffer[T](): Buffer[T] at {global} \x3d {\n  var content: Option[T] in global \x3d None()\n  new Buffer[T] {\n    def capacity() \x3d if (content.isEmpty) 1 else 0\n    def full?() \x3d content.isDefined\n    def empty?() \x3d isEmpty(content)\n    def read() \x3d {\n      val res \x3d content\n      content \x3d None()\n      res\n    }\n    def write(el: T) \x3d content match {\n      case Some(v) \x3d\x3e\n        \x3c\x3e // do raise(BufferOverflow(), "Cannot read element from buffer")\n      case None() \x3d\x3e\n        content \x3d Some(el)\n    }\n  }\n}\n\nnamespace examples {\n  def main() \x3d ignore[BufferOverflow] {\n    // Buffer with capacity 1\n    def b \x3d emptyBuffer[Int](1);\n    println(b.capacity);\n    println(b.full?);\n\n    b.write(17);\n    println(b.read());\n\n    // buffer with capacity 3\n    def ringbuffer \x3d emptyBuffer[Int](3);\n    ringbuffer.write(1);\n    ringbuffer.write(2);\n    println(ringbuffer.read());\n    ringbuffer.write(3);\n    println(ringbuffer.read());\n    println(ringbuffer.read());\n    ringbuffer.write(4);\n    ringbuffer.write(5);\n    println(ringbuffer.read());\n    println(ringbuffer.read());\n  }\n}');
